import React from "react";
import BorderCard from "../BorderCard";

import { Container } from "./styles";

const Summary = (props) => {
  return (
    <Container>
      <BorderCard />
      <BorderCard />
      <BorderCard />
      <BorderCard />
    </Container>
  );
};
export default Summary;
